void update_character_loc_and_mov(struct player *curPlayer){
    // check facing
    if (curPlayer->deltaX != 0){
        if (curPlayer->deltaX > 0){
            curPlayer->facing = 1;
        }
        else{
            curPlayer->facing = -1;
        }
    }

    // update character x bounds
    if (curPlayer->x + curPlayer->deltaX >= 0 && curPlayer->x + curPlayer->deltaX < (320- PLAYER_WIDTH)){
        curPlayer->x = curPlayer->x + curPlayer->deltaX;
    }

    // update character y bounds
    update_character_loc_and_mov_y(curPlayer);

    // decrement number of frames of jump left until 0, then turn the deltaY back to normal
    if (curPlayer->jump_frames > 0){
        curPlayer->jump_frames -= 1;
    }
    else{
        curPlayer->deltaY = 1;
    }

    // decrement number of frames of shooting until 0
    if (curPlayer->shoot_frames > 0){
        curPlayer->shoot_frames -= 1;
    }
    
    // update the character hitpoint
    curPlayer->hitPointX = curPlayer->x + PLAYER_WIDTH / 2;
    curPlayer->hitPointY = curPlayer->y + PLAYER_HEIGHT / 2;

    if (curPlayer->dead_frames > 0){
        curPlayer->dead_frames -= 1;
    }

    if (curPlayer->immunity_frames > 0 && curPlayer->dead_frames == 0){
        curPlayer->immunity_frames -= 1;
    }
    
    curPlayer->deltaX = 0;
}

void update_character_loc_and_mov_y(struct player *curPlayer){
    int playerBottom = curPlayer->y + PLAYER_HEIGHT;

    // check colision of platforms if on decent
    if (curPlayer->deltaY == 1){
        if (playerBottom <= 220 && playerBottom > 180){
            if (playerBottom + curPlayer->deltaY <= 220){
                curPlayer->y += curPlayer->deltaY;
                curPlayer->onPlatform = false;
                return;
            }
            else{
                curPlayer->onPlatform = true;
                return;
            }
        }
        
        bool onPlatform = false;
        if (playerBottom <= 180 && playerBottom > 140){
            for (int i = 0; i < 9; i++){
                if (all_platforms[i].y <= 180 && all_platforms[i].y > 140){
                    if (curPlayer->x + PLAYER_WIDTH >= all_platforms[i].x && curPlayer->x < all_platforms[i].x + all_platforms[i].length){
                        if (playerBottom == all_platforms[i].y){
                            onPlatform = true;
                        }
                    }
                }
            }
        }

        if (playerBottom <= 140 && playerBottom > 100){
            for (int i = 0; i < 9; i++){
                if (all_platforms[i].y <= 140 && all_platforms[i].y > 100){
                    if (curPlayer->x + PLAYER_WIDTH >= all_platforms[i].x && curPlayer->x < all_platforms[i].x + all_platforms[i].length){
                        if (playerBottom == all_platforms[i].y){
                            onPlatform = true;
                        }
                    }
                }
            }
        }

        if (playerBottom <= 100 && playerBottom > 60){
            for (int i = 0; i < 9; i++){
                if (all_platforms[i].y <= 100 && all_platforms[i].y > 60){
                    if (curPlayer->x + PLAYER_WIDTH >= all_platforms[i].x && curPlayer->x < all_platforms[i].x + all_platforms[i].length){
                        if (playerBottom == all_platforms[i].y){
                            onPlatform = true;
                        }
                    }
                }
            }
        }

        if (playerBottom <= 60){
            for (int i = 0; i < 9; i++){
                if (all_platforms[i].y <= 60){
                    if (curPlayer->x + PLAYER_WIDTH >= all_platforms[i].x && curPlayer->x < all_platforms[i].x + all_platforms[i].length){
                        if (playerBottom == all_platforms[i].y){
                            onPlatform = true;
                        }
                    }
                }
            }
        }

        if(onPlatform == false){
            curPlayer->y += curPlayer->deltaY;
        }
        curPlayer->onPlatform = onPlatform;
    }
    // if deltaY is negative - means jumping, check for cieling of screen
    else{
        if (curPlayer->y + curPlayer->deltaY > 0){
            curPlayer->y += curPlayer->deltaY;
        }
        else{
            curPlayer->jump_frames = 0;
        }

        curPlayer->onPlatform = false;
    }
    
}

