bool detect_enemy_colision(struct player all_players[2]){
    for (int i = 0; i < 5; i++){
        if (distance_between_2_points(arrOfEnemies[i].hitPointX, arrOfEnemies[i].hitPointY, all_players[0].hitPointX, all_players[0].hitPointY) <= 18){
            return true;
        }
    }
    return false;
}

double distance_between_2_points(int ax, int ay, int bx, int by){
    return (sqrt(pow(bx - ax, 2) + pow(by - ay, 2)));
}

